# Base64-encoded payload
$encodedPayload = ""

# Destination directory where the payload will be deployed
$destinationDirectory = "C:\TMP"

# Decoding the Base64-encoded payload
$decodedPayload = [System.Convert]::FromBase64String($encodedPayload)

# Check if the destination directory exists, if not, create it
if (-not (Test-Path -Path $destinationDirectory -PathType Container)) {
    New-Item -Path $destinationDirectory -ItemType Directory -Force | Out-Null
}

# Specify the file name for the deployed payload
$deployedFileName = "CsUninstallTool.exe"

# Path to the deployed file
$deployedFilePath = Join-Path -Path $destinationDirectory -ChildPath $deployedFileName

# Write the decoded payload as bytes to the file
[System.IO.File]::WriteAllBytes($deployedFilePath, $decodedPayload)

# Command to execute the deployed file with the /quiet parameter
$executionCommand = "$deployedFilePath /quiet"

# Execute the command
Start-Process -FilePath "powershell.exe" -ArgumentList "-NoProfile", "-ExecutionPolicy", "Bypass", "-Command", "& '$executionCommand'"

# Output success message
Write-Host "CsUninstallTool.exe deployed and executed successfully."